import React from 'react';

const profile = (props) => {
    return(
    <div className="profile"> 
        <section>
            <ul>
                <li>id</li>
                <li>username</li>
                <li>name</li>
                <li>firstName</li>
                <li>email</li>
                <li>signupdate</li>
            </ul>
        </section>
    </div>
    );
}

export default profile;
